import {Canvas} from '@react-three/fiber'
import './styles.css'
import './Model.js'
import Model from './Model.js';
import { Suspense } from 'react'
import { Html,OrbitControls } from '@react-three/drei'
import { Light } from 'three';
import Button from '@mui/material/Button';
import Bottom_Plate_3_Inch from './Bottom_Plate_3_Inch.js';
import Body from './Body.js';
import Test from './Test.js';
import Parentcomponent from './Parentcomponent.js';
import SimpleForm from './SimpleForm.js'
import { createStore, combineReducers } from 'redux'
import { reducer as formReducer } from 'redux-form'

const reducers = {
  // ... your other reducers here ...
  form: formReducer     // <---- Mounted at 'form'
}
const reducer = combineReducers(reducers)
const store = createStore(reducer)
const HTMLOutside = () => {
  return(
      <div>
          <h1 className='title'>Drone Parts Picker</h1>
        </div>
  )
};

const HTMLInside = () => {
  return(
    <Html fullscreen>
      <div className='container'>
        <h1 className='title'>Inside Canvas</h1>
      </div>
    </Html>
  );
}
const Scene = () => {
  return(
    <Canvas colorManagement camera={{position: [0,30,100],fov:70}}>
      <Suspense fallback={null}>
     <pointLight intensity={1.12} position={[0, 50, 100]} />
          <OrbitControls/>
          <Bottom_Plate_3_Inch/>
      </Suspense>

   /
    </Canvas>
  );
}

function App() {
  return(
    <>
        <HTMLOutside/>  
        <Scene />
        <Body/> 
        <Test/>
        <Parentcomponent/>
        <SimpleForm onSubmit={this.submit}/>
    </>
  );
};
require('react-dom');
window.React2 = require('react');
export default App;
